textOriginal:
Tá rolando multa aqui em BH/MG!

A galera do iFood tá tomando as seguintes multas:
Sem EAR;
Sem Colete;
Sem mata-cachorro;
Bag;
Sem placa vermelha;
Estão cobrando um curso, nem sei qual é.
Sei que a GM de BH da mais de 600 de multa, leva a carteira e a moto!

Comecei Uber Eats de bike ontem.. e foi isso que pensei e conversei no BK com outros entregadores;
É bom andar esperto, mas um cara desse tem que ficar paraplégico cagando em fralda o resto da vida ou na cadeia sendo estuprado, atrasar o lado de quem ta na correria nas entregas, as vezes até na chuva..

É nois
